def vectorizer(train, test):
  tfidf = TfidfVectorizer(encoding='utf-8')
  data = pd.concat([train['comments'],test['comments']])
  
  x_data = tfidf.fit(data)
  x_train = tfidf.transform(train['comments'])
  y_train = train['label']
  X = tfidf.transform(test['comments'])
  #y_dev = dev['label']
  return x_train, y_train, X

"""**SVM 분류기로 분류하기**"""

from sklearn.svm import SVC
def Train_model(classifier, x, y, test):
  clf = classifier(probability=True, kernel='linear')
  clf.fit(x, y)
  predictions = clf.predict(test)
  return predictions

x_train, y_train, x_test = vectorizer(train, test)
# test 데이터 예측하기
